import React from "react";
import CartItem from "./cartitem";


export default function CartItemContainer({myCart}){
    return(
        myCart.length>0 ? 
        myCart.map(item=>{
            if(item.amount>0)
                return <CartItem key={item.id} name={item.name} amount={item.amount} price={item.price}/>
        }) : null
    )
}
